   return (
      <div className={style.divCard}>
         <button onClick={() => onClose(id)}>X</button>
         <img src={image} alt='' />
         <Link to={`/detail/${id}`} >
         <h2>{name}</h2>
         </Link>
         {/* <h3>Status: {status}</h3>
